import React from 'react';
import { Link } from 'react-router-dom';
import net from "./network.jpg";

export default class SecStrengthsWeak extends React.Component {
	render() {
		return (
			<>

			<center>
				<br/>
				<img 
					alt="logo" 
					src={net}
					style={{"height" : "300px"}}/>
				<br/>
				<p>Hello</p>
				<br/>
				<Link to="/">Go Back</Link>
				<br/>
				<p>     </p>
			</center>

			</>
		);
	}
}
